import React from 'react';
import InputForm from './Components/InputForm';
import Stack from '@mui/material/Stack';
import '@fontsource/roboto';


function App() {
  return (
    <Stack spacing={4} direction="column">
      <h1 style={{fontFamily: "roboto", color: "white"}}>Number Addition with API and Database Demo</h1>
      <h3 style={{fontFamily: "roboto", color: "white"}}>-Input two numbers below<br />-Press 'Add'<br />-View the result<br />-Press 'Send' to add all values as an entry in the database</h3>
      <InputForm />
      <h3 style={{fontFamily: "roboto", color: "white"}}>*make sure the backend api project is running beforehand</h3>
    </Stack>
  );
}

export default App;
